(defn parse [input]
  (let [rows (->> (string/split input #"\n")
                  (mapv #(string/split % #" -> ")))
        values (into {}
                 (comp (map first)
                       (map #(string/split % #" "))
                       (map (fn [[k v]]
                              [(keyword k) (subs v 1 (dec (count v)))])))
                 rows)
        graph (-> (into {}
                    (comp (filter #(> (count %) 1))
                          (map (fn [[k v]]
                                 [(->> (string/split k #" ")
                                       (first)
                                       (keyword))
                                  (->> (string/split v #", ")
                                       (mapv keyword))])))
                    rows)
                  (graph/digraph))]
    {:values values
     :graph graph}))

(defn root [graph]
  (first (alg/topsort graph)))

(comment
  (root (:graph (parse input)))
  (graph/successors (:graph (parse input)) :vvsvez))